        price: 98500,
        condition: "New",
        image: "https://images.unsplash.com/photo-1523170335258-f5ed11844a49",
    },
    {
        id: 2,
        brand: "Patek Philippe",
        model: "Nautilus 5711",
        description: "Luxury sports watch with stainless steel case.",
        price: 1250000,
        condition: "Pre-owned",
        image: "https://media.gettyimages.com/id/531725359/photo/rolex-wrist-watch.jpg",
    },
];

export default watches;
